import React from 'react';
import { useNavigate } from 'react-router-dom';

function Profile() {
  const navigate = useNavigate();

  return (
    <div className="flex items-center justify-center h-screen bg-gradient-to-br from-pink-300 to-red-400 animate-slide-in">
      <div className="bg-white p-8 rounded-2xl shadow-xl w-96">
        <h2 className="text-3xl font-bold mb-6 text-gray-800">Profile</h2>
        <p className="mb-2 text-gray-600"><strong>Email:</strong> marsya@gmail.com</p>
        <p className="mb-2 text-gray-600"><strong>Name:</strong> Marsya Putra</p>
        <p className="mb-6 text-gray-600"><strong>Student ID:</strong> 12345678</p>

        <button
          onClick={() => navigate('/')}
          className="w-full bg-gray-200 text-gray-800 py-2 rounded-lg shadow-md transition-transform transform hover:scale-105 hover:bg-gray-300"
        >
          Back to Home
        </button>
      </div>
    </div>
  );
}

export default Profile;
